import React from 'react'

function Dish(props) {
    const { dish } = props;
    return (
        <tr>
            <td>{dish.name}</td>
            <td>{dish.desc.slice(0, 10)}...</td>
            <td>{dish.category}</td>
            <td>{dish.subcategory}</td>
            <td>{dish.price}</td>
            <td>{dish.status}</td>
        </tr>
    )
}

export default Dish
